import React from 'react';
import {  siteData } from '../utils/mockData';
import './client.css';
import ClientSlide from './clientSlide';

const Client=(props)=>{
    return(
    <div className='clientPage'>
        {siteData.map((data)=>{
            <div>
                <h1></h1>{data.siteImage}
            {data.para}
            </div>
        }
        )}
    <ClientSlide
             key={props.id}
             image={props.Image}
             quoteIcon={props.quoteIcon}
             para={props.para}
             name={props.name}
             title={props.title}
    />
    </div>
    )
} 
export default Client;
